import React from "react";

function Header() {
    return (
        <>  
          <div className="header">
            <p>Reddit<span>MyVersion</span></p>
          </div>
          <form>
            <input
            type="text"
            placeholder="Search"
            id="search"
            />
            <input
            type="submit"
            />
          </form>
       
        </>
    );
}


export default Header;
